Content-Transfer-Encoding: quoted-printable Thank you for your loan request, which we recieved yesterday, your refinance application has been accepted Good Credit or Not, We are ready to give you a $471,000 loan, after further review, our lenders have established the lowest monthly payments. Approval process will take only 1 minute. Please visit the confirmation link below and fill-out our short 30 second Secure Web-Form. http://bgyrqybox.com/

I decided to back up a bit and try a more simple routine. I have the 
array @id_hits populated and I can search the log for the line and print 
it. The problem is it only finds the first match and that is it.

foreach my $prime_id ( @id_hits ) {
     while ( my $line =  ) {
         if ( $line =~ /$prime_id/ ) {
             print "$line\n";
             next;
         }
     }
}

Do I need to pass it back to the foreach somehow?

Robert

